import { View, Image, StyleSheet, Pressable } from "react-native";
import { useSelector } from "react-redux";
import { RootState } from "../redux";
import { pageDispatcher } from "../redux/pages/action";
const Navbar = () => {
  const { pageId } = useSelector((state: RootState) => state.PageReducer);
  return (
    <View style={styles.navbarMain}>
      <View style={styles.navbarContainer}>
        <Pressable
          onPress={() => pageDispatcher.setPageId(2)}
          style={styles.navbarIcon}
          android_ripple={{ borderless: true, radius: 40 }}
        >
          <Image
            style={pageId === 2 ? styles.selectedNavbarIconImage : styles.navbarIconImage}
            source={require("../../assets/images/list.png")}
          />
        </Pressable>
        <Pressable
          onPress={() => pageDispatcher.setPageId(1)}
          style={styles.navbarIcon}
          android_ripple={{ borderless: true, radius: 40 }}
        >
          <Image
            style={pageId === 1 ? styles.selectedNavbarIconImage : styles.navbarIconImage}
            source={require("../../assets/images/home.png")}
          />
        </Pressable>
        <Pressable
          onPress={() => pageDispatcher.setPageId(3)}
          style={styles.navbarIcon}
          android_ripple={{ borderless: true, radius: 40 }}
        >
          <Image
            style={pageId === 3 ? styles.selectedNavbarIconImage : styles.navbarIconImage}
            source={require("../../assets/images/plus.png")}
          />
        </Pressable>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  navbarMain: {
    position: "absolute",
    alignItems: "center",
    bottom: 20,
  },
  navbarContainer: {
    flexDirection: "row",
    backgroundColor: "#5F9EA0",
    width: "85%",
    justifyContent: "space-between",
    alignItems:'center',
    borderRadius: 20,
    borderColor:'#2F4F4F',
    borderWidth:1
  },
  navbarIcon: {
    padding: 5,
    borderRadius:20
  },
  navbarIconImage: {
    width: 32,
    height: 32,
  },
  selectedNavbarIconImage:{
    width: 40,
    height: 40,
  }
});

export default Navbar;
